/** @format */

import React from "react";
import "antd/dist/antd.css";
import Head from "next/head";
// eslint-disable-next-line react/prop-types
const App = ({ Components }) => {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>규몽이츠</title>
      </Head>
      <Components />
    </>
  );
};

export default App;
